import React from 'react';
 
const Error = () => {
    return (
        <div className="error-page">
        <div className="container">
          <div className="row">
            <div className="col-12">
                <p>Error: Page does not exist!</p>
            </div>
          </div>
        </div>
       </div>
    );
}
 
export default Error;
